import React from 'react'
import Card from "./App";
import Array from "./Array";

function Netflix(){
    return (<Card
        key={Array[0].id}
        img={Array[0].img}
        title={Array[0].title}
        span={Array[0].span}
        ankar={Array[0].ankar}
      />)
}

export default Netflix;
